import { UserMenu } from "../../UserArea/UserMenu/UserMenu";

import "./Header.css";

function Header(): JSX.Element {
  return (
    <div className="Header">
      <Logo width="100" height="100" />
      <h3>Vacations Project</h3>
      <UserMenu />
    </div>
  );
}

export default Header;
